// **************************
// *          SETUP         *
// **************************

function setup() {
  
    //1200/1600 = 0.75
  //1080/1920 = 0.5625
  //1920/1080 = 1.7777778

  aspect = 1.0;
  centerCanvas();
 
  if (windowWidth< windowHeight*aspect){
    w = windowWidth;
    h = Math.round(windowWidth/aspect);
    cnv = createCanvas(w, h);
    size = h;
  } else {
    w = Math.round(windowHeight*aspect);
    h = windowHeight;
    cnv = createCanvas(w, h);
    size = w;
  }

  margin = size/10;
  frameRate(25);
  //pixelDensity(3);


   seed  = Math.floor( random(0, 99999));
   seed = 527;
   
  randomSeed(seed);
  noiseSeed(seed);
 
  paper_color = color(245, 241, 230);
 
 let transp = 0.25;
  boje[0] ='rgba(34, 65, 118, '+ transp+')'; //tamno plava
  boje[1] ='rgba(229, 234,242, '+ transp+')'; // bledo siva
  boje[2] ='rgba(76, 110, 167, '+ transp+')'; ///srednje svio plava
  boje[3] ='rgba(153, 172, 205, '+ transp+')'; // crvena malina
  boje[4] ='rgba(199, 190, 149, '+ transp+')'; //bledo zelena
  boje[5] ='rgba(253, 168, 62, '+ transp+')'; //zuta
  boje[6] ='rgba(97, 83, 118, '+ transp+')'; //ljubicasta
  boje[7] ='rgba(213, 67, 77, '+ transp+')'; // malo zagasitija crvena
  
  strokeWeight(r);
  rectMode(CENTER);

  reset_all();
 
}

function reset_all(){
 
  tl = boje[0];
  tr = boje[1];
  bl = boje[2];
  br = boje[3];
 
  horiz_gradient1 = [];
  horiz_gradient2 = [];
  for (let j=0; j<steps; j++){
    gradient[j] = [];
  }

  let scale = chroma.scale([tl, bl]).mode('lrgb');
  for (let i=0; i<steps; i++) {
    horiz_gradient1.push(scale(i/(steps-1)).hex());
  }
  
  scale = chroma.scale([tr, br]).mode('lrgb');
  for (let i=0; i<steps; i++) {
    horiz_gradient2.push(scale(i/(steps-1)).hex());
  }
  
  for (let j=0; j<steps; j++){
    scale = chroma.scale([horiz_gradient1[j], horiz_gradient2[j]]).mode('lrgb');
    for (let i=0; i<steps; i++){
      gradient[i][j]=scale(i/(steps-1)).hex();
    }
  }
 
  for (let i=0; i<s; i++) {
    pos[i] = []; 
    ppos[i] = [];
    ppos2[i] = [];
    ppos3[i] = [];
    d[i] = [];

    for (let j=0; j<s; j++) {
    //ver1
 
    pos[i][j] = createVector(size*0.65 +termin1[i][j]*size/2, size*0.85+ termin2[i][j]* size/2);
   


    ppos[i][j] = createVector( pos[i][j].x, pos[i][j].y);
    ppos2[i][j] = createVector( pos[i][j].x, pos[i][j].y);
    ppos3[i][j] = createVector( pos[i][j].x, pos[i][j].y);
    }
  }
  strokeCap(SQUARE);
}


 

